from test_script import speedtest


class Solution:
    def numSub(self, s: str) -> int:
        counter从idx开始连续1的个数 = [0]  # 加0不报错
        for ch in reversed(s):
            if ch == '0':
                counter从idx开始连续1的个数.append(0)
            else:
                counter从idx开始连续1的个数.append(counter从idx开始连续1的个数[-1] + 1)
        counter从idx开始连续1的个数 = counter从idx开始连续1的个数[::-1]
        counter从idx开始连续1的个数.pop()  # 把多余的这个0删除掉
        ans = 0
        for i in range(len(s)):
            ans += counter从idx开始连续1的个数[i]
        return ans % int(1e9+7)


speedtest((Solution().numSub, lambda x: 9), ["0110111"])
speedtest((Solution().numSub, lambda x: 2), ["101"])
speedtest((Solution().numSub, lambda x: 21), ["111111"])
speedtest((Solution().numSub, lambda x: 0), ["000"])
speedtest((Solution().numSub, lambda x: 200542505), [""])
